import React from "react";

export default function ShowMaterials({ setIsShowMaterials, materials }) {
  function rendermaterial() {
    if (materials) {
      return materials.map((el, ind) => {
        <div>
          <a href={el.name}>{el.name}</a>
        </div>;
      });
    }
  }
  return (
    <div className="fondoGrisRep">
      <div
        className="row"
        style={{
          justifyContent: "center",
          alignContent: "center",
          height: "100%",
        }}
      >
        <div className="caja">
          <div
            className="cabeceracaja"
            style={{ justifyContent: "center", alignContent: "center" }}
          >
            <h1>Link de Clases Online</h1>
            <div className="cerrar" onClick={() => setIsShowMaterials(false)}>
              <img alt="img" src="./assets/icons/cerrar.png" width="20" />
            </div>
          </div>
          <div className="bodycaja">
            <br />
            <label
              style={{
                textAlign: "center",
                width: "100%",
                marginTop: 5,
                fontSize: 16,
              }}
            >
              Hola, entra al LINK PRIVADO:
            </label>
            <div style={{ textAlign: "center", paddingTop: 18 }}>
              {rendermaterial()}
            </div>
            <p className="text-colum-bold">
              <strong>NOTA:</strong>
            </p>

            <p>
              *Clase de PRUEBA GRATIS, sábado 18 de Abril 8:30 PM. <br />
              *Fecha de inicio: Martes 21 de Abril. <br />
              *Clases Online: Martes, miércoles, jueves y viernes de 8:30 a
              10:00 PM. <br /> *Descarga Zoom. <br />
              *Si deseas clases particulares online, escríbenos al WhatsApp 997
              914 757
            </p>
            <br />
            <h1 style={{ textAlign: "center", fontSize: 18, marginBottom: 18 }}>
              ¡ESTAMOS MEJORANDO PARA BRINDARTE LA MEJOR EXPERIENCIA ONLINE!
            </h1>
          </div>
        </div>
      </div>
    </div>
  );
}
